Descripción de producto:
El estilo combat llegó para quedarse y se ha convertido en el favorito de muchos. En Dasalo te ofrecemos este botín inspirado en este tipo de calzado, el cual fue hecho para diferenciarse con su piel vacuno en acabado natural complementado con piel vacuno grabado, complementado con agujetas y cierre para que su ajuste sea más rápido y cómodo para ti. Como todo calzado combat, se complementó con una suela gruesa, pero que su tamaño no te engañe; jamás condicionamos la comodidad, por lo que esta suela es cómoda y ligera. Úsalas en cualquier temporada con tu outfit preferido, no importa que uses te verás espectacular.
Ficha técnica:
-Corte: Piel vacuno de flor entera lisa y piel vacuno de flor entera grabada. ¿Qué es la piel de flor entera? Si bien la piel vacuno en general es de excelente calidad, existen diferentes categorías y calidades dentro de esta, la flor entera es la de mayor calidad: este nombre lo recibe la piel extraída de la capa más alta y natural de la piel y debe ser seleccionada cuidadosamente de manera manual, ya que no necesitará de procesos químicos que mejoren su apariencia, puesto que no es necesario, además de conservar las características naturales de la piel. El calzado de flor entera es para aquel que busca un par que refleje carácter gracias a las marcas naturales de la piel y que además el par envejezca con gracia.
-Forro: Sintético con plantilla de piel, perfecto para una transpiración óptima.
-Suela: TR. El calzado estilo combat se caracteriza por su suela gruesa inspirada en el estilo militar, nuestro botín conserva esta característica sin perder la comodidad gracias al TR de la más alta calidad, pues encontrarás cada pisada cómoda y ligera.
-Altura de tacón: 4 cm
¿Quiénes somos? Dasalo es una empresa mexicana especializada en zapatos y calzado en general con historia que se remonta a hace más de 50 años. Nos inspira la enorme tradición e historia en el calzado en conjunto con la vanguardia.
